import {TopBar} from "./App";
import  './voice.css';
import {useEffect, useState} from "react";
import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import Typography from '@mui/material/Typography';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import CardContent from "@mui/material/CardContent";
import Card from "@mui/material/Card";
import CircularProgress from '@mui/material/CircularProgress';
import axios from "axios";
import Box from "@mui/material/Box";


const Voice = () => {
    const [imageBase64, setImageBase64] = useState('');
    const[imageBase64_2, setImageBase64_2] = useState('');
    const[title, setTitle] = useState('');
    const [isLoading, setIsLoading] = useState(false);
    const [isVideoUploaded, setIsVideoUploaded] = useState(true);

   useEffect(() => {
        let uuid = new URLSearchParams(window.location.search).get('uuid');
        if (uuid) {
            setIsLoading(true);
            axios(`http://127.0.0.1:5000/voice?uuid=${uuid}`)
                .then(response =>{
                    setImageBase64(response.data.pitch_image);
                    setImageBase64_2(response.data.intensity_image);
                    setTitle(response.data.title)
                })
                .catch(error => {
                    console.error('Error:', error);
                })
             .finally(() => {
                    setIsLoading(false);
                });
        }
    }, []);

     if (isLoading) {
        return (
            <Box sx={{display: 'flex',
                flexDirection: 'column',
                justifyContent: 'center',
                alignItems: 'center',
                height: '100vh',
                width: '100vw'}}>
                <CircularProgress />
                <Typography sx={{ mt: 2 }}>Usually takes <strong>30s to 2 minutes</strong> to load (Related to the length of the video you uploaded)</Typography>
            </Box>
  );
    }

  return (
      <>
          <TopBar isVideoUploaded={isVideoUploaded}/>
          <div>
              <div className="video-card">
                  <Card sx={{ maxWidth: '80%', marginTop: 5, width: 'auto'}}>
                      <CardContent>
                          <video width="100%" controls>
                              {title &&<source src={`/static/${title}`} type="video/mp4" />}
                              Your browser does not support the video tag.
                          </video>
                      </CardContent>
                  </Card>
              </div>
              <Accordion style={{marginTop: 15}}>
                  <AccordionSummary expandIcon={<ExpandMoreIcon />} aria-controls="panel1a-content" id="panel1a-header">
                      <Typography>Summary</Typography>
                  </AccordionSummary>
                  <AccordionDetails>
                      <Typography>
                          1
                      </Typography>
                  </AccordionDetails>
              </Accordion>
              <Accordion>
                  <AccordionSummary expandIcon={<ExpandMoreIcon />} aria-controls="panel2a-content" id="panel2a-header">
                      <Typography>Pitch</Typography>
                  </AccordionSummary>
                  <AccordionDetails>
                      <Typography>
                          {imageBase64 && <img src={`data:image/png;base64,${imageBase64}`} alt="Generated Plot" className="responsiveImage" />}
                      </Typography>
                  </AccordionDetails>
              </Accordion>
              <Accordion>
                  <AccordionSummary expandIcon={<ExpandMoreIcon />} aria-controls="panel2a-content" id="panel2a-header">
                      <Typography>Intensity</Typography>
                  </AccordionSummary>
                  <AccordionDetails>
                      <Typography>
                          {imageBase64_2 && <img src={`data:image/png;base64,${imageBase64_2}`} alt="Generated Plot" className="responsiveImage" />}
                      </Typography>
                  </AccordionDetails>
              </Accordion>
          </div>
      </>
  );
}
export default Voice;
